import React from 'react';
import './CardSection.css';

const CardSection = ({ title, content, children }) => {
  return (
    <div className="card-section">
      <h2>{title}</h2>
      <div className="card-content">
        {content}
        {children}
      </div>
    </div>
  );
};

export default CardSection;
